8,next_target/add,next_target/add,POST,"{""next_year_target"":""1. Mengejar kompetensi yang ada di xinix, artinya saya harus bisa bergaya ala xinix secara skill, gaya main xinix, dan teknologi yang diterapkan di xinix, sehingga setiap project yang saya kerjakan sesuai dengan standarnya xinix dan goal xinix bisa tercapai\r\n\r\n2. Tahun 2013 saya harus lebih familiar dan lebih menguasai lagi bahasa pemograman php javascript jquery ajax CSS3 dan HTML5 dan selanjutnya hanya tinggal pengayaan\r\n\r\n3. Mempercepat speed dalam bekerja\r\n\r\n4. Saya ingin melatih diri saya dalam hal berinteraksi dengan client, saya mau jadi PM untuk project saya sendiri, saya mau berinterkasi dengan client, dan pastinya saya harus mengasah pengetahuan tentang teknis dan mempelajari business proses yang ada pada perusahan client\r\n\r\n5.Saya harap tahun 2013 saya bisa menyumbang sebuah konsep \/ sesuatu yang dapat mempengaruhi kemajuan xinix, apapun itu. Intinya saya ingin bermanfaat untuk xinix.\r\n"",""how_to"":""1. Memperbaiki manajemen diri (Disiplin)\r\n2. Mulai membiasakan diri untuk belajar dan langsung implementasikan\r\n3. Mengasah pikiran untuk bisa menganalisa lebih baik dan lebih tajam"",""xsession"":""f92bfa674349144325b5c479d775e11f""}",192.168.1.125,"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.97 Safari/537.11",,1,,"2012-12-24 12:23:47",putra
